// React
import React, { useEffect, Fragment } from "react";

import { Row, Col, Card } from "antd";
import httpService from "../../../../../services/httpService";

const getPhoto = () => {
  httpService
    .get("https://source.unsplash.com/weekly?water")
    .then(data => console.log(data));
};

useEffect(() => {
  getPhoto();
});

const OrderedList = ({ data }) => {
  console.log(data);
  return (
    <Fragment>
      <Row>
        {data.map(data => (
          <Col span={5} offset={1} className="w-50">
            <Card title={data.table}></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default OrderedList;
